const defaultState = {
    last: null,
    now: null
}

const reducer = (state = defaultState, action) => {
    console.log(state, action);
    switch (action.type) {
        case 'NEW':
            return {
                last: action.payload,
                now: 'xd'
            };
        case 'INC':
            return {
                last: 'xd',
                now: action.type
            };
        default:
            return state;
    }
}

export default reducer;
